import React from "react";

const Checkbox = ({ checked = false, onClick = () => {}, name = "" }) => {

  return (
    <label
      htmlFor=""
      className={`inline-flex text-center items-center justify-center p-1 text-white w-5 h-5 border rounded cursor-pointer  ${
        checked ? "bg-primary border-primary" : "border-strock"
      }`}
      onClick={onClick}
    >
      <input
        type="checkbox"
        className="hidden"
        onChange={() => {}}
        name={name}
      />
      <span>
        <svg
          xmlns="http://www.w3.org/2000/svg"
          fill="none"
          viewBox="0 0 20 20"
          strokeWidth="2"
          stroke="currentColor"
          className="w-4 h-4"
        >
          <path
            strokeLinecap="round"
            strokeLinejoin="round"
            d="M4.5 12.75l6 6 9-13.5"
          />
        </svg>
      </span>
    </label>
  );
};

export default Checkbox;
